const initialValue = { email: "", psw: "" }
const initialValues = { data: [] }

const LoginData = (state = initialValue, action) => {
    switch (action.type) {
        case "FetchLoginData": return { ...state, email: action.payload.email, psw: action.payload.psw }
        default: return state;
    }
}

console.log(initialValue);

export default LoginData;
